import React, { useState, useEffect } from 'react'
import { Dropdown, Grid } from 'semantic-ui-react'
import axios from 'axios'

export default function AutocompletActivite({ informations, informationsRH, handleChange, disable }) {


    const [data, setData] = useState([])

    useEffect(() => {
        const fetchData = async () => {
            const result = await axios.get(
                'http://localhost:3000/activiteData',
            );
            setData(result.data);
        };
        fetchData();
    }, []);



    return (
        <Grid>
            <div className='autoCompletTitre'>Activit√©</div>
            <Dropdown
                onChange={handleChange}
                placeholder='Activite'
                fluid
                search
                name='activite'
                disabled={disable}
                selection
                value={informations.activite || informationsRH.activite}
                options={data}
            />
        </Grid>
    )
}
